import React from 'react'
import './Home.css';
import './loginForm'

function Home() {
return(

    <div className='home-container'>
    <nav>
        <h1 className='home-title'>Vogue </h1>
        <ul>
            <li><a href="#">Home</a></li>
            <li><a href="http://localhost:3000/login">Login</a></li>
            <li><a href="http://localhost:3000/register">Register</a></li>
            <li><a href="http://localhost:3000/cart">Cart</a></li>
            <li><a href="http://localhost:3000/about">About</a></li>
            <li><button onclick="logoutUser()">Odjava</button></li>
            
        </ul>
    </nav>
    </div>

);

}

export default Home;
